import React, { useEffect, useState } from "react";

function Home() {
  const [locations, setLocations] = useState([]);
  console.log(locations);
  useEffect(() => {
    fetch("/locations.json")
      .then((response) => {
        response.json();
      })

      .then((data) => {
        setLocations(data);
      });
  }, []);

  return (
<div className="body-home">
 <h6>Chez vous, partout et ailleur</h6>
</div>
  )
}
  

export default Home;
